import React, { Component } from 'react';
import Head from '../components/Head';
import axios from 'axios';

export default class Classes extends Component {


	constructor(props) {
		super(props);
		this.state = {
			students: [],
			changeStart:'',
			changeEnd:''
		}
		axios.get(`/classes`)
			.then(res => {
				this.setState({ students: res.data });
			}).catch(error => {
				console.log(error);
			});
		this.handleBlur = this.handleBlur.bind(this);
		this.handleClick = this.handleClick.bind(this);


	}

	handleBlur(event) {
		this.setState({ changeStart: event.target.innerHTML });
		console.log('start',this.state.changeStart.valueOf());
		console.log('end',this.state.changeEnd.valueOf());
		console.log(this.state.changeStart.valueOf() == this.state.changeEnd.valueOf() );

		// if(this.state.changeStart.valueOf()===this.state.changeEnd.valueOf())
		// console.log('111');


	}
	handleClick(event) {
		// console.log(event.target.innerHTML);
		this.setState({ changeEnd: event.target.innerHTML });

	}

	render() {
		return (
			<div>
				<Head />
				<div id="body">
					<table>
						<thead>
							<tr>
								<td>name</td>
								<td>password</td>
								<td>class</td>
							</tr>
						</thead>
						<tbody>
							{this.state.students.map((stud)=><tr  key={stud.id}>
								<td><span contentEditable="true"  suppressContentEditableWarning={true} onBlur={this.handleBlur} onClick={this.handleClick}>{stud.name}</span></td>
								<td><span contentEditable="true" suppressContentEditableWarning={true} onBlur={this.handleBlur} onClick={this.handleClick}>{stud.password}</span></td>
								<td><span contentEditable="true" suppressContentEditableWarning={true} onBlur={this.handleBlur} onClick={this.handleClick}>{stud.class}</span></td>
							</tr>)}
							</tbody>
					</table>
				</div>
			</div>
		);
	}
}
